Super rough edges still, BUT this morning, we had the very first end-to-end Universal Money Address (UMA) transactions between different countries, wallets, and currencies powered by #Bitcoin Lightning Network under the hood :

1) In terminal mode from the US with @Bakkt in US dollars (with the wrong fee) to @Bitnob_official in Ghana in Ghanaian Cedi (client-side receive not complete yet, so not shown, but received server-side, performance not optimized yet);

2) From Argentina with @RipioApp in USDC to @Pouch_PH in the Philippines in Philippines peso;

3) From Ghana with @Bitnob_official in BTC (perf not optimized yet) to @Pouch_PH in the Philippines in Philippines peso.

For all but one of these transactions, consumers will never need to know #Bitcoin was the net settlement asset and network between these institutions, just like sending an email doesn't require consumers to know anything about SMTP.

@Lightspark open-sourced and announced UMA less than two months ago, so we're still in the very early phase of the standard roll-out. But, by the time these implementations get into the hands of consumers, the experience will be magical. An always-on, currency-agnostic, 24/7 settlement network with human-readable addresses.

We wanted to share the same day even though much more work will happen to make this production ready in weeks to come.

We're incredibly grateful to all our partners across the world and the ones actively implementing now. We really can't wait to make this mass market in 2024!

